        graph[b - 1][a - 1] = 1

    # DFS
    def dfs(vertex, visited):
        if vertex == N:
            return True
        if visited[vertex]:
            return True
        visited[vertex] = True

        for neighbor in range(N):
            if graph[vertex][neighbor] == 1 and dfs(neighbor, visited):
                return True
        return False

    # count paths
    count = 0
    visited = [False] * N
    for vertex in range(N):
        if dfs(vertex, visited):
            count += 1

    return str(count)

