    rooms = list(map(int, stdin.readline().strip().split()))
    exams = list(map(int, stdin.readline().strip().split()))
    order = []
    visited = set()
    current_room = 0
    current_exam = 0
    current_exam_count = 0
    max_exam_count = max(exams)

    # Determine the safe order
    for i in range(n):
        if exams[i] > 0:
            order.append(i)

    # Assign exams to students
    for i in range(n):
        if exams[i] > 0:
            students = []
            while current_exam < exams[i]:
                room = order[current_room]
                exam = rooms[room]
                if exam not in visited:
                    visited.add(exam)
                    students.append(room)
                    current_room += 1
                    current_exam += exam
                    current_exam_count += exam
                    if current_exam_count > max_exam_count:
                        break
                else:
                    if current_exam > 0:
                        current_exam -= 1
                        current_exam_count -= 1
                    else:
                        break
            if students:
                students.append(i)
                order.append(i)

    # If there is no safe order, return "impossible"
    if len(order) == n:
        return "impossible"
    else:
        return " ".join(map(str, order))

